  var idBufferVertices = gl.createBuffer();
  var vao = gl.createVertexArray();
  gl.bindVertexArray(vao);
  gl.enableVertexAttribArray(attributeLocations.position);
  gl.bindBuffer(gl.ARRAY_BUFFER, idBufferVertices);

